import React, { Component } from 'react';

class List extends Component {
  render() {
      //works for array
      const li = this.props.datal.map((data) => {
          return <li>{data}</li>
      });

      //doesn't work for array of objects
      

      return (
          <ul>
              //works
              {li}
              <p>object</p>
             
          </ul>
      )
  }
}

export default List;
